import React, { useEffect } from 'react';

function Perfil(props){

    useEffect(() => {
        document.title = this.props.atributomio;
    });

    return (
        <div style={{background:"yellow"}}>
            Este es el nuevo componente perfil. {props.atributomio}
        </div>
    );
    
}



export default Perfil
